import React, { useState,useEffect } from 'react';
import {STLViewer} from 'react-stl-obj-viewer';



function STLDisplay(props){



	useEffect(() => {   
		console.log(props.file)
		console.log("1")
	},[props.file]);

	console.log(props.file)
	console.log("2")

return(
null
